import React from 'react';

import './styles/app.scss';

import Header from './Header.js';

function App() {
	return (
		<div className="cp24-app__wrapper">
			<Header />
			<div className="forecast__wrapper">forecast</div>
			<div className="traffic__wrapper">traffic</div>
			<div className="video__wrapper">
				<div className="desktop-player">dekstop player</div>
				<div className="mobile-player">mobile player</div>
			</div>
			<div className="news__wrapper">news</div>
		</div>
	);
}

export default App;
